(defn solve [ss mult rounds]
  (time
    (let [numbers      (-> ss u/str->ints)
          len          (-> numbers count)
          len-         (-> len dec)
          pairs        (->> numbers
                         (map #(-> mult #_(mod len-) (* %)))
                         (map-indexed vector))
          zero         (->> pairs (filter #(-> % second #{0})) first)
          !q           (new ArrayDeque pairs)
          ;; (mod 7 5) => 2
          ;; (mod -7 5) => 3
          right!       (fn [n]
                         (dotimes [_ n]
                           (.addLast !q (.removeFirst !q))))
          scroll-to!   (fn [el]
                         ;; when finds el removes it from q
                         (let [x (.removeFirst !q)]
                           (when (not= x el)
                             (.addLast !q x)
                             (recur el))))]
      ;;move elements:
      (dotimes [_ rounds]
        (doseq [[idx offset :as pair] pairs]
          (scroll-to! pair)
          (right! (mod offset len-))
          (.addFirst !q pair)))
      ;;scroll to start:
      (scroll-to! zero) (.addFirst !q zero)
      ;;result:
      (+
        (do (right! (mod 1000 len)) (second (.peekFirst !q)))
        (do (right! (mod 1000 len)) (second (.peekFirst !q)))
        (do (right! (mod 1000 len)) (second (.peekFirst !q)))))))

(defn p1 [ss] (solve ss 1 1))
(defn p2 [ss] (solve ss 811589153 10))


(assert (= 3 (p1 sample)))
(assert (= 5962 (p1 input)))

(assert (= 1623178306 (p2 sample)))
(assert (= 9862431387256 (p2 input)))